/*
* Prefixed by https://autoprefixer.github.io
* PostCSS: v7.0.29,
* Autoprefixer: v9.7.6
* Browsers: last 4 version
*/


:root {
  font-size:16px;
  --dark01: #171216;
  --dark02: #473F45;
  --dark03: #888888;
  --bright01: #fafafa;
  --bright02: #eeeeee;
  --bright03:#EDEBFD;
  --bright04:#D9D8DE;
  --action: #DE6B6B;
  --accent01: #91768C ;
  --accent02: #FB8D91;
  --accent03: #136E13;
  --accent04: #0B330B;
  --primary01: #383E55;
  --primary02: #B71063;
  --primary03: #901452;
  --primary04: #20171E;
  --primary05: #23101F;
  --link_idle: var(--dark01);
  --link_idle02:  var(--dark02);
  --green: #00ff00;

  --internal_darks: var(--dark03);
  --line_width: 0.125em;
  --em-unitBase: 16;
  --em-unitBasePX: var(--em-unitBase) + "px";
  --body-lineHeight-min: 1.5;
  --body-lineHeight-max: 2;
  --core_tile_size: 64px;
  --border_radius: 0.2rem;
  /*breakpoints vars*/
  --min-screen-width: 300px;

  --bp-s: 24.15; /**/
  --bp-m: 43.75; /**/
  --bp-l: 60; /*960px*/
  --bp-xl: 75; /*1200px*/
  /*Typefaces*/
  --tf-heading: 'Lato', sans-serif;
  --tf-body:  'Lato', sans-serif;
  /*body vars*/
  --em-unitBase: 16;
  --em-unitBasePX: 16px;
  --body-lineHeight-min: 1.3;
  --body-lineHeight-max: 1.75;
/*typo_transition*/
  --type_distance: 0.5em;
  --type_speed: 0.3s;
}
body {
  font-size:16px;
  line-height: 1.5;
}
body,
div,
p,
th,
td,
ul,
li,
h1,
h2,
h3,
h4,
h5,
h6,
blockquote,
figcaption,
cite,
em,
b,
strong,
button {

  font-style: normal;
  font-variation-settings: "wght" var(--txt-wght), "ital" var(--txt-ital);

}
strong{
  font-family: inherit;
  font-weight:600;
}

ul{
  list-style: none;
  counter-reset: item;
  margin: 0;
  padding: 0;
}

li {
  counter-increment: item;
  list-style:none;
  margin: 0;
  padding: 0;

}
ol li{
  list-style-type: none;
}
.paragraph a{
  outline:none;
  font-weight:bolder;
  padding:0.25em;
  text-decoration: none;
  color: var(--dark01);
}
.paragraph a:focus{
  background-image: -webkit-gradient(linear, left top, left bottom, from(var(--dark02)), to(var(--dark01)));
  background-image: -o-linear-gradient(var(--dark02), var(--dark01));
  background-image: linear-gradient(var(--dark02), var(--dark01));
  color: var(--green);
  /*outline: 1px solid var(--dark01);*/
  outline-offset:2px;
}
.project_li a {
  text-decoration: none;
  border-radius:2px;
  border: none;
  margin-top:1em;
  margin-left: -0.5em;
  padding:0.25em;
  padding-left:0.5em;
  padding-right:0.5em;
  background-image: linear-gradient(-90deg, var(--dark02) 0%, var(--link_idle) 50%,transparent 50%, transparent 100%);
  background-size:200%;
  background-position:200%;
  transition:all 0.25s;
  background-repeat:no-repeat;
}
.project_li a:visited {
  color: var(--link_idle);
}
.project_li a:hover {
  background-position:100%;
  color: var(--green);

}
.project_li a:active {

}
.project_li a:focus{
  outline:none;
  background-position:100%;
  color: var(--green);
  /*outline: 1px solid var(--link_idle);*/
  outline-offset:2px;

}

.body_container {
  height: 100vh;
  width: 100vw;
  display: -ms-grid;
  display: grid;
  -ms-grid-rows: 100%;
  grid-template-rows: 100%;
  -ms-grid-columns: 64px auto;
  grid-template-columns: 64px auto;
  overflow: hidden;
  margin: 0;
  padding: 0;
  background: var(--bright01);
}

.body_container > *:nth-child(1) {
  -ms-grid-row:1;
  -ms-grid-column:1;
}

.body_container > *:nth-child(2) {
  -ms-grid-row:1;
  -ms-grid-column:2;
}

.heading_01 {
  --fontsize_min: 2.665rem;
  --fontsize_max: 5.997rem;
  font-family: var(--tf-heading);
  font-size: clamp( var(--fontsize_min), 3.998vmax, var(--fontsize_max));
  font-weight: 900;
  line-height: 1.25;
  letter-spacing: 0.01em;
}
.heading_02 {
  --fontsize_min: 1.999rem;
  --fontsize_max: 3.498rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 2.828vmax, var(--fontsize_max));
  font-weight: medium;
  line-height: 1;
}
.heading_03 {
  --fontsize_min: 1.302rem;
  --fontsize_max: 2.929rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 1.953vmax, var(--fontsize_max));
  font-weight: 600;
  line-height: 1.25;
}
.heading_04 {
  --fontsize_min: 1.042rem;
  --fontsize_max: 2.344rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 1.563vmax, var(--fontsize_max));
  font-weight: light;
  line-height: 1.5;
}
.heading_05 {
  --fontsize_min: 0.833rem;
  --fontsize_max: 1.875rem;
  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 1.25vmax, var(--fontsize_max));
  font-weight: 500;
  line-height: 1.5;
  margin:0;
}
.heading_06 {
  --fontsize_min: 0.75rem;
  --fontsize_max: 1.5rem;
  font-family: var(--tf-body);
  font-size: clamp(var(--fontsize_min), 1vmax, var(--fontsize_max));
  font-weight: medium;
  line-height: 1.5;
}
.paragraph{
  margin-top:0.5rem;
  --fontsize_min: 0.875rem;
  --fontsize_max: 1.237rem;
  font-family: var(--tf-body);
  font-size: clamp(var(--fontsize_min),1vmax, var(--fontsize_max));
  font-weight: 300;
  line-height: 1.5;
  width: 60vw;
  max-width: 36em;
  word-break: normal;

}
.paragraph *{
  font-size: inherit;
}
.paragraph strong{
  font-family: inherit;
  font-size: inherit;
  -webkit-hyphens: inherit;
      -ms-hyphens: inherit;
          hyphens: inherit;
  font-weight: 600;
  line-height: inherit;

}
.small {
  --fontsize_min: 0.75rem;
  --fontsize_max: 0.875rem;

  font-family: var(--tf-body);
  font-size: clamp( var(--fontsize_min), 0.75vmax, var(--fontsize_max));

}
.service{


}
.service::before {
  font-size:1rem;
margin-left:-1.8rem;
margin-right:0.25rem;
content: counter(item);
background: var(--dark01);
border-radius: 50%;
text-align: center;
display: inline-block;
color: white;
width: 1.5rem;
height:1.5rem;

}

.section_testimonials{
  padding-bottom:3rem;
}
.section_contacts{
  height:90vh;
}
.testimonial{

}
.testimonial .paragraph{
  color: var(--dark01);
}
.citation{
  margin-top: 1rem;
  color: var(--dark03);

}
.figcaption {
  font-family: var(--tf-body);
  font-size: calc(var(--h6-fontsize-min) * 1em);
  font-weight: inherit;
  line-height: 1.5;
  opacity: 0.75;
}
.section {
  width: 100%;
  margin: 0;
  margin-top:3rem;
  /* border-bottom: 2px solid var(--dark01);*/
}
.section__content {
  width: 80%;
  margin: auto;
}
.section__heading {
  width: -webkit-fit-content;
  width: -moz-fit-content;
  width: fit-content;
  background-image: -webkit-gradient(linear,left top, right top,from(#333333), color-stop(50%, var(--dark01)), color-stop(50%, transparent));
  background-image: -o-linear-gradient(left,#333333 0%, var(--dark01) 50%, transparent 50%);
  background-image: linear-gradient(90deg,#333333 0%, var(--dark01) 50%, transparent 50%);
  background-size: 200%;
  background-position: 100% 0%;
  background-repeat: repeat-x;
  color: var(--bright01);
  padding-left: 10%;
  padding-right: 0.5rem;
  padding-top: 1%;
  padding-bottom: 1%;
  display: inline-block;
  -webkit-transition: 0.33s;
  -o-transition: 0.33s;
  transition: 0.33s;
}
.section__heading--reveal {
  color: var(--bright01);
  background-position: 0% 0%;
}

.projects_list {
  -webkit-transform: none;
      -ms-transform: none;
          transform: none;
  padding: 0;
  margin: 0;
  width: 66vw;
}

.project_li {
  margin: 0;
  margin-top: 4em;
  margin-left: 0;
  padding: 0;
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-orient: vertical;
  -webkit-box-direction: normal;
      -ms-flex-direction: column;
          flex-direction: column;
  -webkit-box-pack: end;
      -ms-flex-pack: end;
          justify-content: flex-end;
}

.project_li__client {

  display: inline-block;
  width: -webkit-fit-content;
  width: -moz-fit-content;
  width: fit-content;
  padding-right: 0.25em;
  padding-left: 0.25em;
  margin-top:1em;
  color: var(--dark02);
  background-image: -webkit-gradient(linear, left top, right top, from(#d9d9d9), to(#c9c9c9));
  background-image: -o-linear-gradient(left, #d9d9d9, #c9c9c9);
  background-image: linear-gradient(90deg, #d9d9d9, #c9c9c9);
}
.project_li__title {
  padding: 0;
  margin-bottom:0.25em;
  margin-top: 0.25em;

}
.project_li__image {
  display: -webkit-box;
  display: -ms-flexbox;
  display: flex;
  -webkit-box-flex: 0;
      -ms-flex-positive: 0;
          flex-grow: 0;
  -ms-flex-negative: 0;
      flex-shrink: 0;
  display: flex;
  -webkit-box-align: center;
      -ms-flex-align: center;
          align-items: center;
  -webkit-box-pack: center;
      -ms-flex-pack: center;
          justify-content: center;
  width: 100%;
  height:auto;
  min-width: 19vw;
  max-width: 75rem;
